scene.onOverlapTile(SpriteKind.Player, sprites.dungeon.collectibleRedCrystal, function (sprite, location) {
    sprites.destroyAllSpritesOfKind(SpriteKind.Enemy, effects.fire, 500)
    tiles.setTileAt(mySprite.tilemapLocation(), assets.tile`transparency16`)
    LevelComplete()
})
sprites.onDestroyed(SpriteKind.Projectile, function (sprite) {
    BombCycle()
})
scene.onOverlapTile(SpriteKind.Projectile, sprites.dungeon.hazardSpike, function (sprite, location) {
    Bomb.destroy()
})
sprites.onOverlap(SpriteKind.Player, SpriteKind.Enemy, function (sprite, otherSprite) {
    info.changeLifeBy(-1)
    mySprite.sayText("MEOWOUCH!", 1000, true)
    mySprite.setFlag(SpriteFlag.GhostThroughSprites, true)
    scene.cameraShake(5, 1000)
    CanFeelPain = false
    timer.after(2000, function () {
        mySprite.setFlag(SpriteFlag.GhostThroughSprites, false)
        CanFeelPain = true
    })
})
